import { React, useContext, useEffect } from 'react'
import NoteContext from '../context/notes/noteContext'

const About = () => {
  const a = useContext(NoteContext)
  useEffect(() => {
    a.update()
  }, [])
  
  return (
    <div>
      this is about {a.state.name} and he is in class {a.class}
    </div>
  )
}

export default About;
